// ProductList.js
import React, { useState, useEffect } from 'react';
import ProductItem from './ProductItem';

function ProductList({ onAddToCart }) {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Mock products data for demonstration purposes
    setProducts([
      { id: 1, name: 'Beras Premium', harga: 12000, stok: 100, image: 'premium.jpg' },
      { id: 2, name: 'Beras Organik', harga: 15000, stok: 50, image: 'organik.jpg' },
      { id: 3, name: 'Beras Super', harga: 10000, stok: 200, image: 'super.jpg' },
    ]);
  }, []);

  return (
    <div className="product-list">
      {products.map((product) => (
        <ProductItem key={product.id} product={product} onAddToCart={onAddToCart} />
      ))}
    </div>
  );
}

export default ProductList;
